import React from 'react';

export default class QBData extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: []
        };
    }
    componentDidMount() {
        fetch('http://localhost:8080/getInventory', {method: 'GET'})
            .then(res => res.json())
            .then(items=>this.setState({items}))
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }
    render() {
        const {items} = this.state;
        let itemArray = new Array(items.length);
        let i = 0;
        for(var key in items){
        itemArray[i] = items[key];
        i = i + 1;
        }

        const names = [];
        const itemNames = [];

        function f() {
            for(var x in itemArray[0]){
                var temp = itemArray[0][x];
                names[x] = temp;
            }
            for(var y in itemArray[2]){
                var temp1 = itemArray[2][x];
                itemNames[y] = temp1;
                console.log(itemNames)
            }
            return (
                itemNames.map(vals =>(
                    <div style={{marginLeft:'800px'}}> {vals}</div>
                ))
            );
        }


        return (
            f()
        );

    }
}
